import React, { Component } from 'react'; 
import Projects from './project.json'; 

//icons
import Github from './assets/icons/svg/032-github.svg'; 
import Youtube from './assets/icons/svg/116-youtube.svg'; 
import heart from './assets/heart-icon.png'; 
import GoogleDrive from './assets/icons/svg/036-googledrive.svg'; 
import LinkedIn from './assets/icons/svg/052-linkedin.svg';
import Instagram from './assets/icons/svg/044-instagram.svg';

class Portfolio extends Component {

    render() {
        if (!this.state.Pojects.images) {
            return <span>Loading...</span>;
        }
        const ProjectData = Projects.map(
            (project) => {
                return (
                    <>
                    <div className="row">
                        <h3>{project.name}</h3><br></br>
                        <p>{project.description}</p>
                        <div className="row">  
                            <div className="col-sm-6">
                                <img class='cropped' src={project.images[0]} width='100%' alt="Campaignion Input"/><br></br><br></br>
                            </div>
                            <div className="col-sm-6">
                                <img class='cropped' src={project.images[1]} width='100%'alt="Campaignion Output"/><br></br><br></br>
                            </div>
                        </div>    
                        <p>{project.tools}</p>
                    </div>

                    <br></br><br></br>
                    <p>• • • • • • •</p>
                    <br></br><br></br>
                    </>
                )
            }
        )
        return (
            <div>
                <div className="content-container portfolio"> 
                    {ProjectData}
                </div>
            </div>
        )
    }
}

export default Portfolio;
